class ItemGenerator:
    images_folder: str
    attribute_names_list: list
    attributes_list: list = []

    def __init__(self, images_folder: str, _attribute_names: list, _only_allowed_list: list):
        self.images_folder = images_folder
        self.attribute_names_list = _attribute_names
        self.only_allowed_list = _only_allowed_list

    def develop_allowed_combinations_help(self) -> None:
        """Returns the allowed combinations to reduce complexity of allowed_combinations method. Example:
        [[0, 1, [0, 1, 2, 3, 4, 5]], [1, 1, [0, 1, 2, 3, 4]], [2, 1, [0, 1, 2, 3]], [3, 1, [0, 1, 2]], [4, 1, [0, 1]], [5, 1, [0]]]
        the first element is the element in array, for example: [0, 1, [1,2,3,4,5]] means
        0:background can be combined with everything (1), and more specifically with elements [0,..,5], i.e. [hair_back, ..., hair_front]
        """
        attribute_nums = list(range(len(self.attributes_list)))
        allowed_list_high_level = []
        for i in range(len(attribute_nums) - 1):
            allowed_list_high_level.append(
                [i, 1, list(range(len(attribute_nums) - (i + 1)))]
            )
        print("dna_to_create = []")
        print("allow_combinations_help = " + str(allowed_list_high_level))

    def make_enumeration(self) -> None:
        """ Makes each characteristic for use in items.py with equal rarity scores"""

        all_folders = natsorted(
            [f.path for f in os.scandir(self.images_folder) if f.is_dir()]
        )
        search_png_list = [folder + "/*.png" for folder in all_folders]
        final_list = []
        for i, png_files in enumerate(search_png_list):
            new_path = natsorted(glob.glob(png_files))
            new_list = []
            rarity_score = round(100 / len(new_path), 2)
            for j, name in enumerate(new_path):
                new_list.append([j, name, rarity_score])

            self.attributes_list.append(new_list)
            print(self.attribute_names_list[i] + " = " + str(new_list))

    def make_allowed_combinations(self) -> None:
        """ Constructs the allow list based on all the characteristics list. Initially all combinations are allowed"""
        new_allow_list = []
        dna_values = list(map(lambda x: [el[0] for el in x], self.attributes_list))
        for i in range(len(dna_values) - 1):
            all_characteristic_items = []
            for j in range(len(dna_values[i])):
                current_item = dna_values[i][j]
                all_items = []
                for val in range(i + 1, len(dna_values)):
                    all_items.append(dna_values[val])
                all_characteristic_items.append([current_item, all_items])
            new_allow_list.append(all_characteristic_items)
        print("allow_list = " + str(new_allow_list))



    def make_allowed_combinations_2(self) -> None:
        _only_allowed_characteristics = [item[0] for item in self.only_allowed_list]
        new_allow_list = []
        dna_values = list(map(lambda x: [el[0] for el in x], self.attributes_list))
        for i in range(len(dna_values) - 1):
            all_characteristic_items = []
            for j in range(len(dna_values[i])):
                current_item = dna_values[i][j]
                all_items = []

                if [i, j] in _only_allowed_characteristics:
                    lst = self.only_allowed_list[_only_allowed_characteristics.index([i, j])]
                    for n, item in enumerate(lst[1:]):
                        if item == 1:
                            all_items.append(dna_values[n + 1])
                        else:
                            all_items.append(item)
                else:
                    for val in range(i + 1, len(dna_values)):
                        all_items.append(dna_values[val])
                all_characteristic_items.append([current_item, all_items])
            new_allow_list.append(all_characteristic_items)
        # print("allow_list = " + str(new_allow_list))

        # write to text_file
        text_file = open(PATH + "allow_list.txt", "w")
        text_file.write("allow_list = " + str(new_allow_list))
        text_file.close()

    def run(self) -> None:
        self.make_enumeration()
        self.develop_allowed_combinations_help()
        self.make_allowed_combinations_2()


items_list = ItemGenerator(
    images_folder="images",
    _attribute_names=attribute_names,
    _only_allowed_list=only_allowed_list
)
items_list.run()
